INSERT INTO `baike_info` VALUES (1, '增加免疫力 全面均衡适量营养有助促进免疫功能', '<p>	人一生病，就找医生吃药、打针，实际身体越吃越弱，下一次用药的剂量可能就要成倍增加，特别是抗生素效果还会递减……其实，人体有你想象不到的强大自愈力。“自愈力是人体与生俱来的潜能，具有巨大的神奇力量，不会因年龄增大而消失”。那么，如何增加免疫力呢？下面跟随360常识网一起看看吧。</p><p class=\"ql-align-center\">	<img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-center\"><br></p><p>	<strong>如何增加免疫力？</strong></p><p>	<strong>■全面均衡适量营养</strong></p><p>	维生素A能促进糖蛋白的合成，细胞膜表面的蛋白主要是糖蛋白，免疫球蛋白也是糖蛋白。现今都市人不愿意吃猪肝，它含有丰富的维生素，维生素A摄入不足，呼吸道上皮细胞缺乏抵抗力，常常容易患病。</p><p>	维生素C缺乏时，白细胞内维生素C含量减少，白细胞的战斗力减弱，人体易患病。</p><p>	除此之外，微量元素锌、硒、维生素B1、B2等多种元素都与人体非特异性免疫功能有关。所以，除了做到一日三餐全面均衡适量外，还可以补充金施尔康多维元素片等。</p><p>	<strong>■吃一些动物肝脏</strong></p><p>	动物肝脏富含多种有助于促进免疫功能的物质，例如叶酸、硒、锌、镁、铁、铜以及B6、B12等。麦麸中含有可增强免疫功能的镁、锌、硒，可在谷物食品中掺入麦麸。海鲜中也含有铁、锌、镁、硒、铜等有助促进免疫功能的矿物质。</p><p>	<img src=\"http://www.360changshi.com/uploadfile/2020/0506/20200506030925579.jpg\" alt=\"增加免疫力 全面均衡适量营养有助促进免疫功能\"></p><p>	<strong>■适度劳逸</strong></p><p>	适度劳逸是健康之母，人体生物钟正常运转是健康保证，而生物钟“错点”便是亚健康的开始。</p><p>	<strong>■经常锻炼</strong></p><p>	现代人热衷于都市<a href=\"http://www.360changshi.com/sh/\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\"><strong>生活</strong></a>忙于事业，身体锻炼的时间越来越少。加强自我运动可以提高人体对疾病的抵抗能力。</p><p>	<img src=\"http://www.360changshi.com/uploadfile/2020/0506/20200506031009751.jpg\" alt=\"增加免疫力 全面均衡适量营养有助促进免疫功能\"></p><p>	<strong>■培养多种兴趣，保持精力旺盛</strong></p><p>	广泛的兴趣爱好，会使人受益无穷，不仅可以修身养性，而且能够辅助治疗一些心理疾病。</p><p>	<strong>■戒烟限酒</strong></p><p>	医学证明，吸烟时人体血管容易发生痉挛，局部器官血液供应减少，营养素和氧气供给减少，尤其是呼吸道黏膜得不到氧气和养料供给，抗病能力也就随之下降。少酒有益健康，嗜酒、醉酒、酗酒会削减人体免疫功能，必须严格限制。</p><p>	<strong>■多喝茶</strong></p><p>	茶叶中名为“茶氨酸”的化学物质可以使人体抵御感染的能力增强5倍。茶氨酸还能调动人体免疫细胞抵御病毒、细菌以及真菌。</p><p>	<img src=\"http://www.360changshi.com/uploadfile/2020/0506/20200506031053586.jpg\" alt=\"增加免疫力 全面均衡适量营养有助促进免疫功能\"></p><p>	<strong>■心理健康</strong></p><p>	善待压力。把压力看作是生活不可分割的一部分，学会适度减压，以保证健康、良好的心境。一个人的免疫力与情绪有很大关系。研究发现，敌视、悲痛、失落、忧愁等消极情绪都能导致人体免疫力下降，而开朗活泼的性格、愉快的情绪则会提高人体免疫力。因为精神愉快与悲伤苦恼可产生两种不同的生化过程，悲伤忧愁会使机体激素分泌发生变化，引起生理功能紊乱，减弱机体的免疫力。保持乐观情绪乐观的态度可以维持人体于一个最佳的状态，尤其是在现今社会，人们面临的压力很大，巨大的心理压力会导致对人体免疫系统有抑制作用的荷尔蒙成分增多，所以容易受到感冒或其它疾病的侵袭。</p><p>	<strong>■睡眠充足</strong></p><p>	适度劳逸是健康之母，人体生物钟正常运转是健康保证，而生物钟“错点”便是亚健康的开始。人进入睡眠状态后，各种有益于增强免疫功能的作用过程便随即开始。如果每日睡眠少于7至8小时，患病的几率就可能增加。因为长期睡眠不足会给机体造成损害，包括思考能力减退、警觉力和判断力下降、免疫功能低下。</p>');

