-- ----------------------------
INSERT INTO `yaodian_info` VALUES (1, '东莞国药', '<p>	东莞国药集团，企业前身最早称东莞县药品公司，成立于1955年。八十年代，经县（市）编制委员会同意，分别更名为东莞县医药联合公司和东莞市医药总公司。1990年增挂东莞市医药管理局牌子，2001年政企分家。至2004年5月，经市人民政府批准转制，并在<a href=\"https://baike.baidu.com/item/%E5%B7%A5%E5%95%86%E8%A1%8C%E6%94%BF%E7%AE%A1%E7%90%86%E5%B1%80/5616732\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">工商行政管理局</a>注册，正式定名为<a href=\"https://baike.baidu.com/item/%E5%B9%BF%E4%B8%9C%E7%9C%81%E4%B8%9C%E8%8E%9E%E5%9B%BD%E8%8D%AF%E9%9B%86%E5%9B%A2%E6%9C%89%E9%99%90%E5%85%AC%E5%8F%B8/20051340\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">广东省东莞国药集团有限公司</a>，隶属市人民政府<a href=\"https://baike.baidu.com/item/%E5%9B%BD%E6%9C%89%E8%B5%84%E4%BA%A7%E7%9B%91%E7%9D%A3%E7%AE%A1%E7%90%86%E5%A7%94%E5%91%98%E4%BC%9A\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">国有资产监督管理委员会</a>。总部设办公室、人事科、企管科、财统科、技术信息科和营销培训部。旗下有31家公司、4个中心、4个生产企业和700多间直营连锁药店。</p><p>	50多年来,其近十年，在市委、市政府的正确领导下，东莞国药人认真实践“三个代表”重要思想，贯彻落实科学发展观，积极实施品牌战略，以质量著称，誉满莞邑，惠及人众，先后两次被市政府认定为东莞商贸龙头企业。2008年更被省工商局认定为“<a href=\"https://baike.baidu.com/item/%E5%B9%BF%E4%B8%9C%E7%9C%81%E8%91%97%E5%90%8D%E5%95%86%E6%A0%87/3368287\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">广东省著名商标</a>”。</p><p>	东莞国药向来以保证人民用药安全有效为企业宗旨。在规范GSP运作基础上，严格把好<a href=\"https://baike.baidu.com/item/%E9%A6%96%E8%90%A5%E5%93%81%E7%A7%8D/7549263\" target=\"_blank\" style=\"color: rgb(19, 110, 194);\">首营品种</a>检验关和统购配送关，有效地将假劣药品拒于门外，被市民誉为“白玉无瑕”。</p><p>	集团公司秉承“以人为本、尊重人才”的用人之道，积极圈人引智，广招天下英才。每间药店保证有两名以上药师在岗指导用药，提供专业服务。</p><p>	“创造感动、体验服务”是东莞国药定位服务顾客的重要准则。他们注重加强企业文化建设，朝着构建和谐、文明礼貌、敬业奉献的方向，不断推进亲情待客服务，让消费者有宾至如归的感受。</p><p>	东莞国药以发展直营连锁、网络广伸、品种齐全著称，着力推进科学管理，打造国字号“药业航母”。至今保持零售药店全市第一，药品销量全市第一的领先地位，是东莞本土供药的主渠道，是全市医药行业中唯一的一家龙头企业。</p>');

