INSERT INTO `yufang_info` VALUES (1, '全民健身日，他们用运动改变糖尿病', '<p><strong>　运动是良医</strong></p><p>《健康中国行动（2019—2030年）》将糖尿病防治行动作为十五项重大行动之一，鼓励医疗机构为糖尿病患者开展饮食控制指导和运动促进健康指导。为了支持医生更高效地组织患者运动，“社区领袖赋能计划”定制了一系列适合糖尿病患者群体的线上运动课程，包含弹力带、健身操等日常锻炼，以及巧用椅子、水瓶、墙面等简单工具的居家运动，帮助患者足不出户，也能坚持运动。</p><p>疫情期间，线上运动打卡得到了糖友们的踊跃响应。随着疫情防控进入常态化，济阳社区的线下活动也开始有条不紊地开展起来。每位社区医生对接一个居委会，成立糖尿病小组，开展健身操、健步走、八段锦、太极拳等运动，受到了居民的欢迎。在活动开展过程中，社区医生身体力行，动员身边的“运动健将”，为患者提供运动指导，充分调动大家的积极性。参与活动的洪莲琴阿姨养成了日常运动的习惯，心情变好了，幸福感提升了。科学的运动和生活方式帮助洪阿姨打消了刚确诊糖尿病时的焦虑。</p><p>“ ‘社区领袖赋能计划’给我们社区医生提供了工具，让我们能更加有效地组织患者开展运动，让患者在运动中体会乐趣和给身体带来的好处，例如，对控制血糖、血脂的积极影响，通过患者再把这些获益扩散给身边的人，形成示范效应，带动大家动起来。”朱立场补充道。</p><p class=\"ql-align-center\"><img src=\"http://upload.mnw.cn/2020/0810/1597041799815.png\" alt=\"图片 1.png\"></p><p class=\"ql-align-center\">上海市济阳社区和沈阳市第七人民医院开展“糖尿病大讲堂”和健身活动</p><p>中国医药卫生事业发展基金会理事长王丹表示：“今年启动的‘社区领袖赋能计划’独具创新性，由一名社区医生赋能多位社区患者，多个社区的成功经验传播到更多社区、城市，形成‘以一带多’的效应，共同倡导‘运动改变糖尿病’的理念。”</p><p><strong> 动起来，才能站起来！</strong></p><p>参与此次活动的沈阳市第七人民医院情况略有不同：大部分住院患者都是病程较长的糖尿病足患者。内分泌科主任、主任医师甘宇强调，对糖尿病患者来说，运动不可或缺。“我们希望患者能够认识运动的重要性。首先是了解缺乏运动的不良后果，例如血糖增高、抑郁情绪，对糖尿病足的患者来说，更是有肌肉萎缩、骨质疏松的危险。”</p><p>在多年的诊疗过程中，甘主任经常都会面对因为病情，变得自卑、自闭的患者。她坦言，抑郁发生率很高。由国际糖尿病联盟携手国际患者组织以及诺和诺德进行的《糖尿病态度、期望和需求研究2》（DAWN2）调查报告指出，在中国，52%的受访患者会因为糖尿病而感到内心痛苦，而40%的受访患者家属则因为担忧患者而承受较大压力[6]</p>');
INSERT INTO `yufang_info` VALUES (2, '高血压的人饮食要注意什么？专家：不能“重口味”', '<p>一家三口每月的食盐总量不能超过1斤，如果把酱油和其他调料中的盐计算在内，一家三口每月食盐的摄入以不超过半斤为宜</p><p>对于高血压患者来说，保持清淡饮食非常重要。我国专家推荐的居民食盐摄入量为日均不超过5克。那么，怎样才能养成低盐饮食习惯呢？</p><p>改变饮食“重口味”。有人会说自己“天生重口味”，其实不然。婴儿时期前几个月的饮食是不需要加盐的，长大后饮食的食盐含量不断升级，使人逐渐变成了“重口味”。人舌头上的味蕾具有适应性，一旦吃咸，两周后就习惯了，反之亦然。因此，越吃越咸很容易，越吃越淡也不是什么难事儿。在这一点上，家里主厨的人有主动权，可以应用限盐勺、记总量等方式定量控制。炒菜应在出锅前放盐，不能放盐后又多加糖以冲淡咸味，更不能“盐不够酱油凑”，餐桌上尽量不摆咸菜、酱豆腐、火腿肠之类的高钠食品，少放味精、鸡精，做汤则更宜清淡。</p><p>避开食盐“重灾区”。食盐的“重灾区”主要包括麻辣香锅、麻辣烫、羊蝎子、涮肉、炸酱面、酱豆腐、咸菜等，比如一小包榨菜的含盐量已经相当于一天的总摄入量了。因此，建议多以醋、芥末、香油、洋葱等调味品增加味道，逐步减少食盐放量，尽量少用或不用味精，少用酱油、辣酱等。</p><p>控制食盐摄入量。我国人均每天食盐的摄入量为不超过5克。这样算起来，一家三口每月的食盐总量不能超过1斤，如果把酱油和其他调料中的盐计算在内，一家三口每月食盐的摄入以不超过半斤为宜。因此，提倡用研磨瓶装盐，每次只能研磨出少量盐，便于控制。如果肾功能正常，也可以采用低钠盐代替食盐。</p><p>每天运动半小时。规律运动有助于控制体重，每减重10公斤可使血压下降5至20毫米汞柱。坚持每天半小时以上的运动，游泳、打拳、跳广场舞等均可，最容易坚持的是快步走，尤其是约上全家或几位好友，边聊天边大步走，既锻炼了身体，又加深了感情，对精神减压也非常有益。运动一定要微微出汗，脉搏微微加快，以次日不感觉肌肉酸痛为宜。但对于血压超过160/100毫米汞柱的患者，建议控制好血压再逐步加强运动。由于清晨是血压的一个高峰期，易发生心脑血管病意外，最好将运动时间调整在下午或傍晚。</p><p>适当增加钙摄入。低钙饮食容易导致血压升高。目前中国人均每日钙摄入量远低于推荐值，高血压患者要保证奶类及其制品的摄入，如每日服用250至500毫升牛奶，也可吃木耳、豆制品、软骨等含钙多的食物，乳糖不耐受患者可以用酸奶或去乳糖牛奶代替。老年人、骨质疏松患者或其他有补钙需求的人，可在医生指导下适当补充钙剂和维生素D。同时，多去户外晒太阳。因为玻璃对紫外线的隔离，即使室内有阳光，皮肤也无法合成利于钙吸收的维生素D。</p><p>按时服用降压药。建议设定手机闹钟，提醒患者按时服药，以防血压波动。常用的药物，最好按天、按顿提前分好，放于家里的餐桌表面醒目位置（尤其是水杯旁），容易漏服的患者，在外出的背包和办公室里也备好少许药品。高龄健忘者在药物旁边放一个台式日历和笔，服药之后立即勾画标记，以免漏服甚至重复吃药。如果不小心漏服，不要盲目补服或加量。补服前，患者需测量血压值，根据血压的具体情况进行判断。因夜晚血压会慢慢降低，夜间必须补服药物时最好减半剂量，以免夜间血压过低导致心脑血管事件。补服后，次日服药前也要先测一下血压水平，根据情况决定是否按原剂量服用。</p>');

